#include "Stable.h"

#include <stdio.h>

static const uint64_t AFile = 0x8080808080808080ULL;
static const uint64_t HFile = AFile >> 7;

static const uint64_t FullBitboard = 0xFFFFFFFFFFFFFFFFULL;

inline uint32_t base2_to_base3(uint64_t mover, uint64_t enemy) {
    return base2ToBase3Table[mover] + 2 * base2ToBase3Table[enemy]; 
}

uint64_t edge_stable(uint64_t mover, uint64_t enemy) {
#define BB_EXTRACT_COLUMN(COL) \
    base2_to_base3(EXTRACT_BITS_U64(mover, (COL), 8, 8), \
                   EXTRACT_BITS_U64(enemy, (COL), 8, 8))

    return
        row0_stable[base2_to_base3(mover & 0xFF, enemy & 0xFF)]
        | row7_stable[base2_to_base3(mover >> 56, enemy >> 56)]
        | col7_stable[BB_EXTRACT_COLUMN(7)]
        | col0_stable[BB_EXTRACT_COLUMN(0)];
}

static uint64_t fill_right_wrap(uint64_t g, uint64_t p) {
    g |= p & (g >> 1);
    p &= (p >> 1);
    g |= p & (g >> 2);
    p &= (p >> 2);
    g |= p & (g >> 4);
    return g;
}

static uint64_t fill_right(uint64_t g, uint64_t p) {
    p &= ~AFile;
    return fill_right_wrap(g, p);
}

static uint64_t lr_empty(uint64_t empty) {
    uint64_t lr_empty = HFile & fill_right(empty, FullBitboard);
    lr_empty |= lr_empty << 1;
    lr_empty |= lr_empty << 2;
    lr_empty |= lr_empty << 4;
    return lr_empty;
}

static uint64_t ud_empty(uint64_t empty) {
    uint64_t ud_empty = empty;
    ud_empty |= (ud_empty >> 8);
    ud_empty |= (ud_empty >> 16);
    ud_empty |= (ud_empty >> 32);
    ud_empty |= (ud_empty << 8);
    ud_empty |= (ud_empty << 16);
    ud_empty |= (ud_empty << 32);
    return ud_empty;
}

static uint64_t fill_up_left(uint64_t g, uint64_t p) {
    p &= ~HFile;
    g |= p & (g << 9);
    p &= (p << 9);
    g |= p & (g << 18);
    p &= (p << 18);
    g |= p & (g << 36);
    return g;
}

static uint64_t fill_down_right(uint64_t g, uint64_t p) {
    p &= ~AFile;
    g |= p & (g >> 9);
    p &= (p >> 9);
    g |= p & (g >> 18);
    p &= (p >> 18);
    g |= p & (g >> 36);
    return g;
}

static uint64_t uldr_empty(uint64_t empty) {
    return fill_down_right(fill_up_left(empty, FullBitboard), FullBitboard);
}

static uint64_t fill_up_right(uint64_t g, uint64_t p) {
    p &= ~AFile;
    g |= p & (g << 7);
    p &= (p << 7);
    g |= p & (g << 14);
    p &= (p << 14);
    g |= p & (g << 28);
    return g;
}

static uint64_t fill_down_left(uint64_t g, uint64_t p) {
    p &= ~HFile;
    g |= p & (g >> 7);
    p &= (p >> 7);
    g |= p & (g >> 14);
    p &= (p >> 14);
    g |= p & (g >> 28);
    return g;
}

static uint64_t urdl_empty(uint64_t empty) {
    return fill_down_left(fill_up_right(empty, FullBitboard), FullBitboard);
}

uint64_t full_stable(uint64_t mover, uint64_t enemy) {
    uint64_t stable = edge_stable(mover, enemy);

    // find filled rows                                            
    const uint64_t empty = ~(mover | enemy);

    uint64_t lr_stable = ~lr_empty(empty);                       
    uint64_t ud_stable = ~ud_empty(empty);
    uint64_t uldr_stable = ~uldr_empty(empty);                                  
    uint64_t urdl_stable = ~urdl_empty(empty);
    
    // find disks adjacent to other disks of the same colour
    const uint64_t leftOf = ((mover&(mover<<1)) | (enemy & (enemy<<1)))&~HFile;
    const uint64_t rightOf = ((mover&(mover>>1)) | (enemy & (enemy>>1)))&~AFile;
    const uint64_t upOf = ((mover&(mover<<8)) | (enemy & (enemy<<8)));
    const uint64_t downOf = ((mover&(mover>>8)) | (enemy & (enemy>>8)));
    const uint64_t ulOf = ((mover&(mover<<9)) | (enemy & (enemy<<9)))&~HFile;
    const uint64_t drOf = ((mover&(mover>>9)) | (enemy & (enemy>>9)))&~AFile;
    const uint64_t urOf = ((mover&(mover<<7)) | (enemy & (enemy<<7)))&~AFile;
    const uint64_t dlOf = ((mover&(mover>>7)) | (enemy & (enemy>>7)))&~HFile;
    
    // iterative - is it adjacent to a stable disk of the same colour?
    for (;;) {
        lr_stable |= ((stable<<1)&leftOf) | ((stable>>1)&rightOf);
        ud_stable |= ((stable<<8)&upOf) | ((stable>>8)&downOf);
        uldr_stable |= ((stable<<9)&ulOf) | ((stable>>9)&drOf);
        urdl_stable |= ((stable<<7)&urOf) | ((stable>>7)&dlOf);
                              
        uint64_t new_stable = stable | (lr_stable & ud_stable & uldr_stable & urdl_stable);
        if (new_stable == stable) {
            break;
        }
        stable = new_stable;
    }
    
    return stable;
}

